import React from 'react'
import styled from 'styled-components'

import { THEME } from '../../theme'

const StyledLink = styled.a`
  color: (--var);
  font-size: 14px;
  line-height: 21px;
  :hover {
    color: ${ THEME.FONT_COLOR };
    text-decoration: none;
  }
`

export const AppLink = ({ children, ...rest }) => (
  <StyledLink { ...rest }>
    { children }
  </StyledLink>
)
